import ExpenseItem from "./components/ExpenseItem";


function App() {
  const expenses = [
    {
      id: "e1",
      title: "Paper Cups",
      amount: 700,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "Cl", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Mangos",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "Lunch",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem />
    </div>
  );
}

export default App;
